import { ListGroup, ListGroupItem } from "reactstrap";

const Menu=()=>{
    return (
        <div>
            <ListGroup>
                <ListGroupItem action tag="a" href="#">Home</ListGroupItem>
                <ListGroupItem action tag="a" href="#">Add Course</ListGroupItem>
                <ListGroupItem action tag="a" href="#">View Courses</ListGroupItem>
                <ListGroupItem action tag="a" href="#">About</ListGroupItem>
                <ListGroupItem action tag="a" href="#">Contact</ListGroupItem>

            </ListGroup>
        </div>
    )
}

export default Menu;
